function custom_format_checkbox( $value, $field_type, $field ) {
 
    if ( 'checkbox' == $field_type ) {
 
        if ( ! empty( filter_var( $value, FILTER_VALIDATE_BOOLEAN ) ) ) {
            $value = 'true';
        } else {
            $value = '';
        }
    }
 
    return $value;
 
}
 
